/* src/index.css - Implementação de responsividade desktop */
:root {
  font-family: Inter, system-ui, Avenir, Helvetica, Arial, sans-serif;
  line-height: 1.5;
  font-weight: 400;
  color-scheme: light dark;
  color: rgba(255, 255, 255, 0.87);
  background-color: #242424;
  font-synthesis: none;
  text-rendering: optimizeLegibility;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  margin: 0;
  padding: 0;
  overflow-x: hidden;
}

#root {
  width: 100vw;
  height: 100vh;
  display: flex;
  flex-direction: column;
}

/* Estilos responsivos para desktop */
@media (min-width: 768px) {
  /* Ajustes para telas médias e grandes */
  .app-container {
    display: grid;
    grid-template-columns: 280px 1fr;
    grid-template-rows: auto 1fr auto;
    grid-template-areas: 
      "header header"
      "sidebar main"
      "sidebar footer";
    height: 100vh;
    width: 100vw;
  }

  .chat-container {
    grid-area: main;
    display: flex;
    flex-direction: column;
    min-width: 0; /* Permite que o flex item encolha abaixo do conteúdo natural */
  }

  .sidebar {
    grid-area: sidebar;
    overflow-y: auto;
  }

  .header {
    grid-area: header;
  }

  .footer {
    grid-area: footer;
  }
}

@media (min-width: 1024px) {
  /* Ajustes para telas grandes */
  .app-container {
    grid-template-columns: 320px 1fr;
  }

  .sidebar {
    max-width: 320px;
  }
}

@media (min-width: 1200px) {
  /* Ajustes para telas muito grandes */
  .app-container {
    grid-template-columns: 350px 1fr;
  }

  .sidebar {
    max-width: 350px;
  }
}

/* Estilos para mobile - mantendo a experiência responsiva */
@media (max-width: 767px) {
  .app-container {
    display: flex;
    flex-direction: column;
    height: 100vh;
  }

  .sidebar {
    position: absolute;
    top: 0;
    left: 0;
    height: 100vh;
    z-index: 100;
    transform: translateX(-100%);
    transition: transform 0.3s ease;
  }

  .sidebar.open {
    transform: translateX(0);
